import React from "react";

// Importing the Bootstrap CSS 
import "bootstrap/dist/css/bootstrap.min.css";
import "./app-styles.css"

import Header from "../components/structure/Header";
import Footer from "../components/structure/Footer_2";
import ImageImport from "../components/structure/ImageImport";
import Aktuelles from "../components/Akutelles/Aktuelles";
import Termine from "../components/Akutelles/Termine";
import Oeffnungszeiten from "../components/Akutelles/Oeffnungszeiten"; 



function App() {
  return (
    <div>
      <Header />
      <ImageImport 
        img= "/img/Startbild.png"
        alt= "Startbild"
        className = "titleimage"
      />
      <Aktuelles />
      <Termine />
      <Oeffnungszeiten />
      <Footer />
    </div>
  );
}

export default App;
